  [],\n\t\"revision_timestamp\": \"2015-09-27T00:19:41.954410\",\n\t\"name\": \"2011-u-s-army-corps-of-engineers-usace-topographic-lidar-alabama-mississippi-and-louisiana\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"These files contain classified topographic
  and bathymetric lidar data as unclassified valid topographic data (1), valid topographic
  data classified as ground (2), Invalid topographic data classified as lowpoints
  (7), validtopographic data acquired with the bathymetric sensor (14), invalid topographic
  and bathymetric data (17). Classes 1 and 2 are defined in accordance with the American
  Society for Photogrammetryand Remote Sensing (ASPRS) classification standards, while
  classes 14 and 17 are classes specific to NOAA CSC. These data were collected by
  the Compact Hydrographic Airborne Rapid Total Survey (CHARTS) systemalong the coast
  of Mississippi. CHARTS integrates topographic and bathymetric lidar sensors, a digital
  camera and a hyperspectral imager on a single remote sensing platform for use in
  coastal mapping and charting activities.Data coverage generally extends along the
  coastline from the waterline inland 500 meters (topography) and offshore 1,000 meters
  or to laser extinction (bathymetry). Native lidar data is not generally in a format
  accessible tomost Geographic Information Systems (GIS). Specialized in-house and
  commercial software packages are used to process the native lidar data into 3-dimensional
  positions that can be imported into GIS software for visualizationand further analysis.
  Horizontal positions, provided in decimal degrees of latitude and longitude, are
  referenced to the North American Datum of 1983 (NAD83). Vertical positions are referenced
  to the NAD83 ellipsoid and providedin meters. The National Geodetic Survey's (NGS)
  GEOID03 model is used to transform the vertical positions from ellipsoid to orthometric
  heights referenced to the North American Vertical Datum of 1988 (NAVD88). The 3-D
  positiondata are sub-divided into a series of LAS files, each covering approximately
  5 kilometers of shoreline. The format of the file is LAS version 1.2. Data for Louisiana
  was collected on May 31st, 2011. Data for Alabama was collectedfrom June 2nd, 2011
  to June 4th, 2011. Data for Mississippi was collected from June 1st, 2011 to June
  3rd, 2011.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
